import React from "react"
import {GoogleLogin} from "react-google-login"

const clientId = "687510174429-stq4gsnugh62mq0joeb0apsfnmcvcpm5.apps.googleusercontent.com"

function Login(){

    function onSuccess(res){
        console.log("Login Success")
        console.log(res.profileObj.name)
    }

    function onFailure(res){
        console.log(`Login failed`)
    }

    return(
        <div>
            <GoogleLogin clientId={clientId} buttonText="Login" onSuccess={onSuccess}
            onFailure={onFailure} cookiePrivacy={"single_host_origin"} isSignedIn={true} />
        </div>
    )
}

export default Login;
